import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
  BrowserRouter,
  Routes,
  Outlet,
} from "react-router-dom";
import React, { useEffect, useState } from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Sidebar from "./components/Sidebar";
import Home from "./components/Home";
import Student from "./components/Student";
import Main from "./components/Main";
import Teacher from "./components/Teacher";
import Company from "./components/Company";
import Add_company from "./components/Add_company";
import Add_student from "./components/Add_Student";
import Add_teacher from "./components/Add_teacher";
import Course from "./components/Course";
import Add_course from "./components/Add_course";
import Add_job from "./components/Add_job";
import Jobs from "./components/Jobs";
import Blog from "./components/Blog";
import Add_blog from "./components/Add_blog";
import Project from "./components/Project";
import Add_project from "./components/Add_project";
import Add_event from "./components/Add_event";
import Event from "./components/Event";
import Profile from "./components/Profile";
import Innovation from "./components/Innovation";
import Add_innovation from "./components/Add_innovation";
import Test from "./components/Test";
import Add_test from "./components/Add_test";
import Add_contact from "./components/Add_contact";
import Webinar from "./components/Webinar";
import Add_webinar from "./components/Add_webinar";
import Transaction from "./components/Transaction";
import Add_transaction from "./components/Add_transaction";
import Old_papers from "./components/Old_papers";
import Add_Old_paper from "./components/Add_Old_paper";
import Add_About from "./components/Add_About";
import Contactform from "./components/Contactform";
import Add_Contactform from "./components/Add_Contactform";
import Login from "./components/Login";
import Teacher_reg from "./components/Teacher_reg";
import Company_reg from "./components/Company_reg";

const Layout = () => {
  return (
    <>
      <Header></Header>
      <Sidebar></Sidebar>
      <Outlet></Outlet>
    </>
  );
};

function App() {
  const [auth, setAuth] = useState(sessionStorage.getItem("user"));
  const [role_id, setRole] = useState(sessionStorage.getItem("role"));
  return (
    <>
      <BrowserRouter>
        {auth && role_id == 1 ? (
          <>
            <Layout />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/Home" element={<Home />} />
              <Route path="/Student" element={<Student />} />
              <Route path="/Add_Student" element={<Add_student />} />
              <Route path="/Add_Student/:id" element={<Add_student />} />
              <Route path="/Innovation" element={<Innovation />} />
              <Route path="/Add_innovation" element={<Add_innovation />} />
              <Route path="/Add_innovation/:id" element={<Add_innovation />} />
              <Route path="/Teacher" element={<Teacher />} />
              <Route path="/Add_Teacher" element={<Add_teacher />} />
              <Route path="/Add_Teacher/:id" element={<Add_teacher />} />
              <Route path="/Company" element={<Company />} />
              <Route path="/Add_Company" element={<Add_company />} />
              <Route path="/Add_Company/:id" element={<Add_company />} />
              <Route path="/Course" element={<Course />} />
              <Route path="/Add_Course" element={<Add_course />} />
              <Route path="/Add_Course/:id" element={<Add_course />} />
              <Route path="/Jobs" element={<Jobs />} />
              <Route path="/Add_job" element={<Add_job />} />
              <Route path="/Add_job/:id" element={<Add_job />} />
              <Route path="/Project" element={<Project />} />
              <Route path="/Add_project" element={<Add_project />} />
              <Route path="/Add_project/:id" element={<Add_project />} />
              <Route path="/Test" element={<Test />} />
              <Route path="/Add_test" element={<Add_test />} />
              <Route path="/Add_test/:id" element={<Add_test />} />
              <Route path="/Event" element={<Event />} />
              <Route path="/Add_event" element={<Add_event />} />
              <Route path="/Add_event/:id" element={<Add_event />} />
              <Route path="/Add_about" element={<Add_About />} />
              <Route path="/Add_about/:id" element={<Add_About />} />
              <Route path="/Oldpapers" element={<Old_papers />} />
              <Route path="/Add_oldpaper" element={<Add_Old_paper />} />
              <Route path="/Add_oldpaper/:id" element={<Add_Old_paper />} />
              <Route path="/Webinar" element={<Webinar />} />
              <Route path="/Add_webinar" element={<Add_webinar />} />
              <Route path="/Add_webinar/:id" element={<Add_webinar />} />
              <Route path="/Transaction" element={<Transaction />} />
              <Route path="/Add_transaction" element={<Add_transaction />} />
              <Route
                path="/Add_transaction/:id"
                element={<Add_transaction />}
              />
              <Route path="/Contactform" element={<Contactform />} />
              <Route path="/Add_Contactform" element={<Add_Contactform />} />
              <Route
                path="/Add_Contactform/:id"
                element={<Add_Contactform />}
              />
              <Route path="/Profile" element={<Profile />} />
              <Route
                path="/Add_innovation"
                exact
                element={<Add_innovation />}
              />
              <Route path="/Blog" element={<Blog />} />
              <Route path="/Add_blog" element={<Add_blog />} />
              {/* <Route path="/UpdateStudent/:id" element={<UpdateStudents />} /> */}
            </Routes>
          </>
        ) : auth && role_id == 2 ? (
          <>
            <Layout />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/Home" element={<Home />} />
              <Route path="/Course" element={<Course />} />
              <Route path="/Add_Course" element={<Add_course />} />
              <Route path="/Add_Course/:id" element={<Add_course />} />
              <Route path="/Test" element={<Test />} />
              <Route path="/Add_test" element={<Add_test />} />
              <Route path="/Add_test/:id" element={<Add_test />} />
              <Route path="/Webinar" element={<Webinar />} />
              <Route path="/Add_webinar" element={<Add_webinar />} />
              <Route path="/Add_webinar/:id" element={<Add_webinar />} />
              <Route path="/Blog" element={<Blog />} />
              <Route path="/Profile" element={<Profile />} />
            </Routes>
          </>
        ) : auth && role_id == 3 ? (
          <>
            <Layout />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/Home" element={<Home />} />
              <Route path="/Student" element={<Student />} />
              <Route path="/Profile" element={<Profile />} />
            </Routes>
          </>
        ) : (
          <>
            <Routes>
              <Route path="/" element={<Login />} />
              <Route path="/Teacher_reg" element={<Teacher_reg />} />
              <Route path="/Company_reg" element={<Company_reg />} />
            </Routes>
          </>
        )}
      </BrowserRouter>
    </>
  );
}
export default App;
